import React from 'react'

function User({userRepo, loading}) {

  return (
    <div>
    <div className='userData'>
    <p>Meet the  Team</p>
    <a className='btn' > Request Collaboration</a>
    <a className='btn' > <Link to="contactUs">Contact</Link></a>
    </div>

      {loading ? (
        <div className='repo-Load'>Loading...</div> 
      ) : (
        <div className='repo-cards'>
        { userRepo.map((repo) => ( 
        <div key= {repo.id} className='repo-wrapper' >
        <div className='repo'>
            <h3>{repo.full_name}</h3>
            <h3>{repo.description}</h3>
            <p> Languages used :{repo.language}</p>
            <a href={repo.url} className='btn' > Check Out Repository </a>
        </div>
        </div>
        ))}
        </div>
      )}

    </div>
  )
}

export default User
